import React from 'react';
import Header from '../components/Header';

const Homepage = () => {
  return (
    <div>
      <Header />
      <h1>Welcome to CampCalendar</h1>
      <p>Plan your kids' summer activities and camps easily.</p>
    </div>
  );
};

export default Homepage;
